import classes from "./Loader.module.css";
import { CRow, CCol, CSpinner } from "@coreui/react";
const Loader = () => {
  return (
    <div className={classes.spinner}>
      <CSpinner color="primary" variant="grow" />
    </div>
  );
};
export default Loader;
